import React from "react";
import {FirstName} from "./ComA";

const ComD = () => {
    return(
        <>
        <FirstName.Consumer>
            {(fname)=> {
                return(
                    
                
                <h1>Hello I Am {fname}</h1>

                );
            }}
        </FirstName.Consumer>

        </>


    );
};
export default ComD;
